import styled from "styled-components";

const EditorStyles = styled.div`
  .editor__wrap {
    margin: 10px;
    border: 1px solid;
    border-radius: 4px;
  }

  .textarea-emoji {
    #tab-panel {
      padding-top: 10px;
      .bem {
        display: inline-block;
        margin: 4px;
      }
    }
  }
`;
export default EditorStyles;
